window.bookSummaryJSON = "<p>The planet Athshe was a paradise whose people were blessed with a mystical awareness of existence.</p> <p>Then the conquerors arrived and began to rape, enslave, and kill humans with a flicker of humanity. The athseans were unskilled in the ways of war, and without weapons. But the gentle tribesmen possessed strange powers over their dreams. And the alien conquerors had taught them how to hate....</p>"; 
